<script>
import { defineComponent, ref } from "vue";
import { useMotion } from "@vueuse/motion";

export default defineComponent({
  setup() {
    const animateIt = ref();

    const { variant } = useMotion(animateIt, {
      initial: {
        x: -100,
        opacity: 0,
      },
      enter: {
        x: 0,
        y: 0,
        opacity: 1,
        transition: {
          type: "spring",
          stiffness: 400,
          damping: 20,
          delay: 50,
          ease: "easeIn",
          onComplete: () => {
            variant.value = "levitate";
          },
        },
      },
      levitate: {
        y: 15,
        transition: {
          duration: Math.floor(Math.random() * (4000 - 100)) + 100,
          repeat: Infinity,
          ease: "easeInOut",
          repeatType: "mirror",
        },
      },
    });

    return {
      animateIt,
    };
  },
});
</script>

